// /// @DnDArgument : "code" "/*$(13_10)$(13_10)**********INTRODUCTION**********$(13_10)$(13_10)A quick guide to using the Inventory asset.$(13_10)$(13_10)This asset is relatively easily installed into any project.$(13_10)You do not need to understand how it all works but I recommend reading through$(13_10)this guide to get some understanding of what is required to use the asset.$(13_10)$(13_10)You will have to tinker for a while to get the small parts of the asset completely$(13_10)compatible with your project, such as depth etc... These things are out of my control$(13_10)unfortunately so I am unable to help with them.$(13_10)$(13_10)Everyone has their own preferences for things like inventory position on the screen,$(13_10)character behaviour, etc... so I have left all of that stuff up to you, any changes$(13_10)can be made easily with some minor tweaking.$(13_10)$(13_10)The asset was designed to be highly customisable so play away with it.$(13_10)You can always download a new copy. You will also be eligible for all future updates.$(13_10)$(13_10)So far I have only tested this on a Windows 7 PC and so I am unsure of its compatibility with other platforms.$(13_10)$(13_10)$(13_10)$(13_10)$(13_10)**********IMPORTANT OBJECTS**********$(13_10)$(13_10)//obj_inventory_tracker//$(13_10)The obj_inventory_tracker is the main controlling force of the asset. This$(13_10)object holds many of the variables which you can customise to make the asset$(13_10)behave exactly as you want to.$(13_10)$(13_10)//obj_item parent//$(13_10)This is the parent of all items which will be collectable by your character. Each item$(13_10)itself can state its own initial variables otherwise the default initial variables will be used.$(13_10)You should be able to add your own custom variables to items to enhance their functionality if needed.$(13_10)$(13_10)$(13_10)$(13_10)$(13_10)**********TRANSFERRING TO YOUR PROJECT**********$(13_10)$(13_10)The following is a required list of files needed for a smooth install:$(13_10)$(13_10)//SPRITES$(13_10)spr_font_square$(13_10)spr_inventory_slot$(13_10)spr_inventory_cursor_red$(13_10)spr_inventory_cursor_blue$(13_10)$(13_10)//SCRIPTS$(13_10)scr_draw_text_outline$(13_10)scr_collision_rectangle_custom$(13_10)scr_object_collision_detector$(13_10)$(13_10)//OBJECTS$(13_10)obj_item_parent$(13_10)obj_inventory_tracker$(13_10)$(13_10)//SOUNDS (optional)$(13_10)snd_inventory_edge_reached$(13_10)snd_item_collection$(13_10)snd_item_discard$(13_10)snd_item_use$(13_10)$(13_10)You should simply go to your existing project and import components from the asset$(13_10)right across, that way any possible source of error will be elimated. To do this$(13_10)right click in the left hand pane of Game Maker Studio and select the "Add Existing..."$(13_10)option.$(13_10)$(13_10)$(13_10)$(13_10)$(13_10)**********USING THE ASSET**********$(13_10)Once you have all the above components imported into your project, the best course of action is$(13_10)to:$(13_10)$(13_10)-open obj_inventory_tracker, open the customisable variables section, now change the settings to suit your needs.$(13_10)$(13_10)-create a new item, make obj_item_parent its parent.$(13_10)$(13_10)-decide the item's initial variables, conditions and actions (default initial variables found in obj_item_parent).$(13_10)It may be best to simply duplicate an existing item to begin with and simply alter its variables as practice.$(13_10)Refer to your target objects as obj_inventory_tracker.my_target.$(13_10)Always remember to use "Call Inherited Event" action appropriately for each event within the item.$(13_10)$(13_10)-Remember to always assign a single inventory tracker to be created, it is persistent$(13_10)so you need to remember to destroy it when your characeter meets his end.$(13_10)$(13_10)$(13_10)$(13_10)**********FINAL NOTES**********$(13_10)There is a decent amount below the surface which I recommend not trying to alter unless you know what you are doing.$(13_10)Feel free to tinker but the asset is fairly complicated so always backup before you begin.$(13_10)$(13_10)Have Fun :D$(13_10)$(13_10)$(13_10)$(13_10)$(13_10)*********************$(13_10)CHANGELOG$(13_10)*********************$(13_10)1.30$(13_10)-Removed minimised version of the asset as it is unnecessary$(13_10)-Removed the need to import macros into your projects$(13_10)-Made inventory sounds customisable$(13_10)"
